import React, { useState } from "react";
import axios from 'axios'
import Button from 'react-bootstrap/Button'
import 'bootstrap/dist/css/bootstrap.min.css';

const LogoutButton = () => {

    const logout = () => {
        // axios
        //     .delete("/logout")
        //     .then((res) => {
        //         console.log(res)
        //     }
        // )
        fetch("/logout", {
            method: "DELETE",
            headers: {
                "Content-Type": "application/json"
            }
        }).then((res) => {
            if (res.ok) {
                console.log(res)
                // loggedIn(false)
                return res.ok
            } else {
                console.log("Logout Unsucessful")
            }   
        }
        )
    }

    const handleClick = () => {
        logout()
    }

    return (
        <Button 
            variant="secondary" 
            onClick={handleClick}
        >
            Logout
        </Button>
    )
}

export default LogoutButton
